import React, {useState,useEffect} from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Axios from "axios";

const customerSignup = () => {
  Axios.post("http://localhost:3001/")
}

function CustomerLogin () {
  const[name,setName]=useState("");
  const[email,setEmail]=useState("");
  const[password,setPassword]=useState("");
  return(
      <div>
      <h1 className="customer-heading">Uber <span className="heading-eats">Eats</span></h1>
      <h1 className="form-floating">Customer SignUp</h1>
      <div class="form-floating">
       <input type="text" class="form-control" id="floatingName" placeholder="John Doe" name="name" onChange={(e) =>{
         (setName=e.target.value)
       }} />
       <label for="floatingName">Name</label>
      </div>
      <div class="form-floating mb-3">
       <input type="email" class="form-control" id="floatingInput" placeholder="name@example.com" name="email" onChange={(e) => {
         (setEmail=e.target.value)
       }}/>
       <label for="floatingInput">Email address</label>
      </div>
      <div class="form-floating">
       <input type="password" class="form-control" id="floatingPassword" placeholder="Password" name="password" onChange={(e) =>{
         setPassword=(e.target.value)
       }} />
       <label for="floatingPassword">Password</label>
       <button onClick={customerSignup} type="button" class="btn btn-primary cutomer-button">Submit</button>
     </div>
      </div>
  );
}



export default CustomerLogin;
